import React from 'react';
import {Link, Route} from 'react-route-dom';
import Learn from './Learn';

const Contact = (props) => {
    return (
        <div>
        <p>Contact Page</p>
        <Link to={`${props.url}/learn}`} role="button" className="btn btn-link">
            Learn More
        </Link>{''}
        <Link to="/contact" role="button" className="btn btn-link">
            Learn Less
        </Link>
        <Route exact path={`${props.match.url}`} component={Learn}/>
        </div>
    )
}

export default Contact;
